import React from "react";
import "../Header/Header.scss";

function Header() {
  return (
    <>
      <header className="brand__header">
        <nav className="brand__nav">
          <a href="/">Habitualr</a>
        </nav>
      </header>
    </>
  );
}

export default Header;
